import React from 'react';
import './App.css';
import styled from 'styled-components';

const PageStyles = styled.div`
.App {
  text-align: center;
}

.App-logo {
  animation: App-logo-spin infinite 20s linear;
  height: 40vmin;
  pointer-events: none;
}

.App-header {
  background-color: #282c34;
  min-height: 100vh;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  font-size: calc(10px + 2vmin);
  color: white;
}

.App-link {
  color: #61dafb;
}
`;


function App() {
  return (
    <PageStyles>
    <div className="App">
      <header className="App-header">
        <img src={process.env.PUBLIC_URL + '/images/Aatrox.png'} /> 
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
    </PageStyles>
  );
}

export default App;
